window.addEventListener("load",()=>{var e=new Date("Jan 5, 2023 15:37:25").getTime(),r=setInterval(function(){var n=new Date().getTime(),o=e-n,t=Math.floor(o/864e5),l=Math.floor(o%864e5/36e5),i=Math.floor(o%36e5/6e4),c=Math.floor(o%6e4/1e3);document.querySelectorAll(".timer").forEach(e=>{e.querySelector(".days").innerHTML=t,e.querySelector(".hours").innerHTML=l,e.querySelector(".minutes").innerHTML=i,e.querySelector(".seconds").innerHTML=c}),o<0&&(clearInterval(r),document.getElementById("demo").innerHTML="EXPIRED")},1e3)});